import React, { useState, useEffect } from 'react';

const NavBar = () => {
  const [activeLink, setActiveLink] = useState('home');
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);

    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleSetActiveLink = (value) => {
    setActiveLink(value);
  };

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="container">
        <div className="navbar-brand">
          <div className="logo">
            meet jo<b>.</b>
          </div>
        </div>
        <button className="navbar-toggler" type="button" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="navbar-collapse">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a href="#home" className={`nav-link ${activeLink === 'home' ? 'active' : ''}`} onClick={() => handleSetActiveLink('home')}>Home</a>
            </li>
            <li className="nav-item">
              <a href="#skills" className={`nav-link ${activeLink === 'skills' ? 'active' : ''}`} onClick={() => handleSetActiveLink('skills')}>Skills</a>
            </li>
            <li className="nav-item">
              <a href="#projects" className={`nav-link ${activeLink === 'projects' ? 'active' : ''}`} onClick={() => handleSetActiveLink('projects')}>Projects</a>
            </li>
            <li className="nav-item">
              <a href="#connect" className={`nav-link ${activeLink === 'connect' ? 'active' : ''}`} onClick={() => handleSetActiveLink('connect')}>Contact</a>
            </li>
          </ul>
          <div className="navbar-text">
            <div className="social-icon">
              <a href="https://github.com/joeygitari" target="_blank" rel="noreferrer"><img src={navIcon1} alt="GitHub" /></a>
              <a href="https://www.linkedin.com/in/joanne-gitari-48105b235/" target="_blank" rel="noreferrer"><img src={navIcon2} alt="LinkedIn" /></a>
              <a href="https://twitter.com/jo_gitari" target="_blank" rel="noreferrer"><img src={navIcon3} alt="Twitter" /></a>
            </div>
            <button className="vvd" onClick={() => window.location.hash = 'connect'}><span>Let's connect</span></button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default NavBar;
